plt.figure(figsize = (8,5))
sn.heatmap(conf_matrix, annot=True,fmt='d',cmap="YlGnBu")

"""Матрица ошибок показывает 652 +5 = 667 правильных предсказания и 87 +7 = 94 неправильных.

Истинные положительные результаты: 5

Истинных негативов: 652

Ложные срабатывания: 7 (ошибка типа I)

Ложно отрицательные результаты: 94 (ошибка II типа)
"""

TN=cm[0,0]
